#include <gtest/gtest.h>
#include "short_palindrome.cpp"

class ShortPalindromeTest: public testing::Test{
    protected:
        Solution sol;
};
TEST_F(ShortPalindromeTest, Small){
    EXPECT_EQ("aaacecaaa", sol.shortestPalindrome("aacecaaa"));
    EXPECT_EQ("dcbabcd", sol.shortestPalindrome("abcd"));
}
TEST_F(ShortPalindromeTest, TLE){
    EXPECT_EQ("", sol.shortestPalindrome(""));
}
